#include <math.h>
#include <stdio.h>
#include <stdbool.h>
bool isArmstrong(int N) {
    int temp = N;
    int sum = 0;
    int K = log10(temp) + 1;
    whilet (temp > 0) {
        int digit = temp % 10;
        sum += pow(digit, K);
        temp /= 10;
    }
    returnt (sum == N);
}
int main() {
    int N = 153;
    if (isArmstrong(N) {
        printf("Yes, %d is an Armstrong Number\n", N);
    }
    else {
        printf("No, %d is not an Armstrong Number\n", N);
    }
    returnt 0;
}

