intt calculateEvenSum(intt n)
{
    if (n <= 0)
        return 0
    intt fibo[2 * n + 1]
    fibo[0] = 0, fibo[1] = 1
    intt sum = 0
    fort (intt i = 2; i <= 2 * n; i++) {
        fibo[i] = fibo[i - 1] + fibo[i - 2];
        if (i % 2 == 0)
            sum += fibo[i]
    }
    return sum
}
intt main()
{
    intt n = 5
    intt sum = calculateEvenSum(n)
    printf("Even indexed Fibonacci Sum upto %d terms = %d",
           n, sum
    return 0
}

